// src/Projects.js
import React from 'react';

const Projects = () => {
  return (
    <section id="projects">
      <h2>Projects</h2>
      <ul>
        <li>Project 1: Description</li>
        <li>Project 2: Description</li>
        <li>Project 3: Description</li>
      </ul>
    </section>
  );
};

export default Projects;
